⠀
The older I have gotten, the more I have realized that the need to “stunt” really isn’t worth anything.⠀
⠀
Do I have a roof over my head? Food on the table? Clothes on my back and the kids?⠀
⠀
If I can say yes to all of that, then I have done my job. Everything else is just extra. Being fulfilled spiritually is more important than the “value” of something.⠀
⠀
As always I will keep it real. With that said there are a few things I won’t compromise on...like my girl over at @flowertunits. I am not about that synthetic life anymore 😂😂😂⠀
